import React from 'react';
// import { Link, useNavigate } from 'react-router-dom';
import './sidebar.css';

const Sidebar = () => {
  const navigate = useNavigate();

  const handleSidebarItemClick = (route) => {
    navigate(route);
  };

  return (
    <div className="sidebar">
      <div className="sidebar-item" onClick={() => handleSidebarItemClick('/dashboard')}>
        Dashboard
      </div>
      <div className="sidebar-item" onClick={() => handleSidebarItemClick('/apikeys')}>
        API Keys
      </div>
      <div className="sidebar-item" onClick={() => handleSidebarItemClick('/sdks')}>
        SDKs
      </div>
      <div className="sidebar-item" onClick={() => handleSidebarItemClick('/deployments')}>
        Deployments
      </div>
        <div className="sidebar-item">Wizard</div>
    </div>
  );
};

export default Sidebar;
